import React from 'react';

function Home() {
  return (
    <div className="text-center mt-8">
      <h1 className="text-4xl font-bold text-blue-500">Welcome to the Home Page!</h1>
      <p className="mt-4">This is where you can put your main content.</p>
    </div>
  );
}

export default Home;
